import React, { Component } from 'react';
class LoginPage extends Component {
    render() { 
        return ( 
            <div>
                <form>
                    <input type="text" id="login" class="d-block m-auto" name="login" placeholder="login" />
                    <input type="text" id="password" class="d-block" name="login" placeholder="password" />
                    <input type="submit" class="d-block" value="Log In" />
                </form>
            </div>
         );
    }
} 
 
export default LoginPage;
